import { useEffect, useState } from "react";
import axios from "axios";
import AdminLayout from "./AdminLayout";
import "./AdminDashboard.css";

import { Bar, Pie, Line } from "react-chartjs-2";
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  BarElement,
  ArcElement,
  LineElement,
  PointElement,
  Tooltip,
  Legend,
} from "chart.js";

ChartJS.register(
  CategoryScale,
  LinearScale,
  BarElement,
  ArcElement,
  LineElement,
  PointElement,
  Tooltip,
  Legend
);

function Metric({ title, value, className }) {
  return (
    <div className={`metric-card ${className}`}>
      <span>{title}</span>
      <h3>{value}</h3>
    </div>
  );
}

export default function AdminDashboard() {
  const [data, setData] = useState(null);

  useEffect(() => {
    axios
      .get("/api/admin/dashboard/metrics")
      .then((res) => setData(res.data))
      .catch(console.error);
  }, []);

  if (!data) return <p className="loading">Loading...</p>;

  const barData = {
    labels: ["Research", "SIH", "MSME", "Grants", "Publications", "Awards"],
    datasets: [
      {
        label: "Total Records",
        data: [
          data.research,
          data.sih,
          data.msme,
          data.grants,
          data.publications,
          data.awards,
        ],
      },
    ],
  };

  const pieData = {
    labels: ["Students", "Faculty"],
    datasets: [
      {
        data: [data.students, data.faculty],
      },
    ],
  };

  const lineData = {
    labels: ["Research", "SIH", "MSME", "Grants"],
    datasets: [
      {
        label: "Innovation Growth",
        data: [data.research, data.sih, data.msme, data.grants],
        fill: true,
        tension: 0.4,
      },
    ],
  };

  return (
    <AdminLayout>
      <h2 className="dashboard-title">Admin System Overview</h2>

      {/* METRICS */}
      <div className="metrics-grid">
        <Metric title="Research" value={data.research} className="research" />
        <Metric title="Startups" value={data.startups} className="startups" />
        <Metric title="Publications" value={data.publications} className="publications" />
        <Metric title="Grants" value={data.grants} className="grants" />
        <Metric title="SIH" value={data.sih} className="sih" />
        <Metric title="MSME" value={data.msme} className="msme" />
        <Metric title="Awards" value={data.awards} className="awards" />
        <Metric title="Students" value={data.students} className="students" />
        <Metric title="Faculty" value={data.faculty} className="faculty" />
      </div>

      {/* CHARTS */}
      <div className="charts-grid">
        <div className="chart-box">
          <h4>Overall Contributions</h4>
          <Bar data={barData} />
        </div>

        <div className="chart-box">
          <h4>User Distribution</h4>
          <Pie data={pieData} />
        </div>

        <div className="chart-box full">
          <h4>Innovation Trend</h4>
          <Line data={lineData} />
        </div>
      </div>
    </AdminLayout>
  );
}
